import React from "react";
class UploadSong extends React.Component {
  state = {};
  boxStyle = {
    position: "relative",
    width: "872px",
    height: "629px",
    background: "#050516"
  };
  innerBoxStyle = {
    position: "absolute",
    width: "650px",
    height: "300px",
    left: "111px",
    top: "165px"
  };
  render() {
    return (
      <div style={this.boxStyle}>
        <div style={this.innerBoxStyle}>
          <img src="./SVG-group-icons/upload icon" />
        </div>
      </div>
    );
  }
}

export default UploadSong;
